const StockDetails = function({stock}) {
    return (
        <div className="stock-details">
            <h4>{stock.name}</h4>
            <p><strong>Shares: </strong> {stock.shares}</p>
            <p><strong>Invested Amount: $</strong> {stock.investment_amount}</p>
            <p>{stock.createdAt}</p>
        </div>
    )
}
